const INITIAL_STATE = {
  usersRegister: [{}],
};

function generalReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
    case 'LOGIN':
      return {};
    case 'REGISTER':
      return {};
    default:
      return state;
  }
}

export default generalReducer;
